Methods contained in the ViewReportTablesUpdater class obtain DB connections to perform their work. However, in certain situations, the work those methods perform should actually be part of larger transactions. Example? CIMOM removal (see https://bugs.eclipse.org/bugs/show_bug.cgi?id=167175).

The methods that obtain DB connections should be overloaded, such that there is a version that accepts a connection being used in a larger transaction. For example, the deleteDependentViews() method looks something like this:

public void deleteDependentViews(
    String entityClass,
    String entityKey) {
  DBConnection connection = null;
  try {
    DBConnPoolDataSource ds = DBConnPoolDataSource.getInstance();
    connection = (DBConnection) ds.getPooledConnection();

    // Use connection to do work ...
  } finally {
    try {
      if (connection != null)
          connection.close();
    } catch (Exception e) { e.printStackTrace(); }
  }
}

To support more effective use of transactions, it can broken down into two methods that look like this:

public void deleteDependentViews(String entityClass, String entityKey) {
  DBConnection connection = null;
  try {
    DBConnPoolDataSource ds = DBConnPoolDataSource.getInstance();
    connection = (DBConnection) ds.getPooledConnection();
    deleteDependencyViews(connection, entityClass, entityKey);
  } finally {
    try {
      if (connection != null)
          connection.close();
    } catch (Exception e) { e.printStackTrace(); }
  }
}

public void deleteDependentViews(
    DBConnection connection,
    String entityClass,
    String entityKey) {
  // Use connection to do work ...
}

Code leveraging ViewReportTablesUpdater should be updated for more effective use of transactions. Changes will likely span several classes, as Connection objects will need to be passed around to make their way to ViewReportTablesUpdater.

The transaction isolation solution to bug #167175 should be revisited. It should be backed-out in favor of better transaction management.

The .classpath SWT on gtk currently looks like this: <classpathentry kind="src" path="Eclipse SWT PI/gtk"> <attributes> <attribute value="org.eclipse.swt.gtk.linux.x86" name="org.eclipse.jdt.launching.CLASSPATH_ATTR_LIBRARY_PATH_ENTRY"/> </attributes> </classpathentry>
This won't compile on all platforms where gtk runs, ie linux.ppc, linux.ia64, linux.x86_64, solaris.sparc and solaris.x86 all have different fragments.
Would be nice if we could use variables when defining our library path so that we could define our library path to be something like org.eclipse.swt.gtk.${os}.${arch}

This happens when there is a TreeEditor on any column, (other than the first column) and the column being edited is moved or resized.

Snippet:

import org.eclipse.swt.*;
import org.eclipse.swt.graphics.*;
import org.eclipse.swt.widgets.*;
import org.eclipse.swt.layout.*;
import org.eclipse.swt.custom.*;

public class Snippet {

public static void main (String [] args) {
	final Display display = new Display ();
	final Color black = display.getSystemColor (SWT.COLOR_BLACK);
	Shell shell = new Shell (display);
	shell.setLayout (new FillLayout ());
	final Tree tree = new Tree (shell, SWT.BORDER|SWT.FULL_SELECTION);
	TreeColumn col = new TreeColumn(tree, SWT.NONE);
	col.setResizable(true);
	col.setWidth(100);
	col.setText("Tree Column One");
	col = new TreeColumn(tree, SWT.NONE);
	col.setResizable(true);
	col.setWidth(100);
	col.setText("Tree Column Two");
	tree.setHeaderVisible(true);
	for (int i=0; i<16; i++) {
		TreeItem itemI = new TreeItem (tree, SWT.NONE);
		itemI.setText (new String[] {"Item " + i, "col 2"});
		for (int j=0; j<16; j++) {
			TreeItem itemJ = new TreeItem (itemI, SWT.NONE);
			itemJ.setText (new String[] {"Item " + j, "col 2"});
		}
	}
	final TreeItem [] lastItem = new TreeItem [1];
	final TreeEditor editor = new TreeEditor (tree);
	tree.addListener (SWT.Selection, new Listener () {
		public void handleEvent (Event event) {
			final TreeItem item = (TreeItem) event.item;
			if (item != null && item == lastItem [0]) {
				boolean isCarbon = SWT.getPlatform ().equals ("carbon");
				final Composite composite = new Composite (tree, SWT.NONE);
				if (!isCarbon) composite.setBackground (black);
				final Text text = new Text (composite, SWT.NONE);
				final int inset = isCarbon ? 0 : 1;
				composite.addListener (SWT.Resize, new Listener () {
					public void handleEvent (Event e) {
						Rectangle rect = composite.getClientArea ();
						text.setBounds (rect.x + inset, rect.y + inset, rect.width - inset * 2, rect.height - inset * 2);
					}
				});
				Listener textListener = new Listener () {
					public void handleEvent (final Event e) {
						switch (e.type) {
							case SWT.FocusOut:
								item.setText (text.getText ());
								composite.dispose ();
								break;
							case SWT.Verify:
								String newText = text.getText ();
								String leftText = newText.substring (0, e.start);
								String rightText = newText.substring (e.end, newText.length ());
								GC gc = new GC (text);
								Point size = gc.textExtent (leftText + e.text + rightText);
								gc.dispose ();
								size = text.computeSize (size.x, SWT.DEFAULT);
								editor.horizontalAlignment = SWT.LEFT;
								Rectangle itemRect = item.getBounds (), rect = tree.getClientArea ();
								editor.minimumWidth = Math.max (size.x, itemRect.width) + inset * 2;
								int left = itemRect.x, right = rect.x + rect.width;
								editor.minimumWidth = Math.min (editor.minimumWidth, right - left);
								editor.minimumHeight = size.y + inset * 2;
								editor.layout ();
								break;
							case SWT.Traverse:
								switch (e.detail) {
									case SWT.TRAVERSE_RETURN:
										item.setText (text.getText ());
										//FALL THROUGH
									case SWT.TRAVERSE_ESCAPE:
										composite.dispose ();
										e.doit = false;
								}
								break;
						}
					}
				};
				text.addListener (SWT.FocusOut, textListener);
				text.addListener (SWT.Traverse, textListener);
				text.addListener (SWT.Verify, textListener);
				editor.setEditor (composite, item, 1);
				text.setText (item.getText ());
				text.selectAll ();
				text.setFocus ();
			}
			lastItem [0] = item;
		}
	});
	shell.pack ();
	shell.open ();
	while (!shell.isDisposed()) {
		if (!display.readAndDispatch ()) display.sleep ();
	}
	display.dispose ();
}
}

