MessageBox (and subclasses of Dialog in general) don't have api for hooking event listeners like Activate/Deactivate, Hide/Show, etc.

The following snippet hooks these events on the MessageBox's parent shell, and it does receive the events correctly.  Does this snippet work for you?  And if so, can you clarify the problem you're seeing?

public static void main(String[] args) {
	Display display = new Display();
	final Shell shell = new Shell(display);
	shell.setBounds(10, 10, 90, 90);
	shell.open();
	shell.addShellListener(new ShellAdapter() {
		public void shellDeactivated(ShellEvent e) {
			System.out.println("deactivated");
		}
		public void shellActivated(ShellEvent e) {
			System.out.println("activated");
		}
	});
	MessageBox box = new MessageBox(shell);
	box.setText("text");
	box.setMessage("message");
	box.open();
	while (!shell.isDisposed()) {
		if (!display.readAndDispatch()) display.sleep();
	}
	display.dispose();
}

